import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { authAPI } from '../services/api';

const Login = ({ onLogin }) => {
  const [formData, setFormData] = useState({
    login: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await authAPI.login(formData);
      const { access_token, user } = response.data;
      onLogin(user, access_token);
    } catch (error) {
      setError(error.response?.data?.error || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{width: '100vw', height: '100vh', position: 'relative', background: '#EBF5FD', overflow: 'hidden'}}>
      <div style={{width: '87%', height: '80%', left: '6.5%', top: '10%', position: 'absolute', background: 'white', boxShadow: '0px 4px 4px 3px rgba(0, 0, 0, 0.25)', borderRadius: 20}} />

      {/* Left side content */}
      <div style={{width: '28%', left: '15%', top: '25%', position: 'absolute', color: '#03045E', fontSize: '3.5vw', fontFamily: 'Calibri', fontWeight: '700'}}>Welcome Back to</div>
      <div style={{width: '12%', left: '15%', top: '35%', position: 'absolute', color: 'black', fontSize: '3.5vw', fontFamily: 'Calibri', fontWeight: '700'}}>Back2U</div>
      <div style={{width: '23%', left: '15%', top: '45%', position: 'absolute', color: 'black', fontSize: '1.5vw', fontFamily: 'Calibri', fontWeight: '400'}}>Your trusted space to recover and return rightful owners</div>
      <div style={{width: '15%', left: '15%', top: '60%', position: 'absolute', textAlign: 'center', color: 'black', fontSize: '1.5vw', fontFamily: 'Calibri', fontWeight: '700'}}>Sign in to your account</div>

      {/* Form */}
      <form onSubmit={handleSubmit}>
        {/* Username Input */}
        <input
          type="text"
          name="login"
          placeholder="Enter your username"
          value={formData.login}
          onChange={handleChange}
          required
          style={{
            width: '25%', height: '5%', left: '60%', top: '30%', position: 'absolute',
            padding: '10px', fontSize: '1.2vw', border: '1px solid #ccc', borderRadius: 5
          }}
        />

        {/* Password Input */}
        <input
          type="password"
          name="password"
          placeholder="Enter your password"
          value={formData.password}
          onChange={handleChange}
          required
          style={{
            width: '25%', height: '5%', left: '60%', top: '40%', position: 'absolute',
            padding: '10px', fontSize: '1.2vw', border: '1px solid #ccc', borderRadius: 5
          }}
        />

        {/* Error Message */}
        {error && (
          <div style={{
            left: '60%', top: '50%', position: 'absolute',
            color: 'red', fontSize: '1vw'
          }}>
            {error}
          </div>
        )}

        {/* Submit Button */}
        <button
          type="submit"
          disabled={loading}
          style={{
            width: '27%', height: '8%', left: '59%', top: '55%', position: 'absolute',
            background: '#2E72F9', borderRadius: 10, border: 'none',
            color: 'white', fontSize: '1.8vw', fontFamily: 'Calibri',
            cursor: loading ? 'not-allowed' : 'pointer'
          }}
        >
          {loading ? 'Signing In...' : 'Sign In'}
        </button>
      </form>

      {/* Sign Up Link */}
      <div style={{left: '60%', top: '70%', position: 'absolute', color: 'black', fontSize: '1.5vw'}}>
        Don't have an account? 
        <Link to="/register" style={{color: '#2E72F9', textDecoration: 'none', marginLeft: 10}}>Sign Up</Link>
      </div>
    </div>
  );
};

export default Login;
